function beautifyDate(date) {
		var str = "";
		var buf;

		buf = date.getDate()
		if (buf < 10) {
			buf= "0" + buf;
		}
		str += buf+'.'

		buf = date.getMonth()+1;
		if (buf < 10) {
			buf = "0" + buf;
		}
		str += buf + '.';

		buf = date.getFullYear()
		if (buf < 10){
			buf = "0" + buf
		}
		str += buf + " ";

		buf = date.getHours()
		if (buf < 10){
			buf = "0" + buf
		}
		str += buf + ":";

		buf = date.getMinutes()
		if (buf < 10){
			buf = "0" + buf
		}
		str += buf;


	return str
}

function openListWindow(list) {
	tableList.innerHTML = "";	
	currentTableList = [];	
	tableListContainer.style.display = "block";
	for (var i = 0; i < list.length; i++) {

		var date = beautifyDate(new Date(list[i].timestamp));

		currentTableList.push(list[i]);
		tableList.insertAdjacentHTML("beforeend", "<p class=green-text id=tableList_" + i + " style=cursor:pointer;>" + date + "</p>");
	}

}

function fetchData(address, fromDate, toDate) {
	var result = [];
	var day = (24 * 60 * 60 * 1000);
	var to;
	var from = fromDate;

	if (toDate) to = toDate;
	else to = from + day

	var queryObj = {
		type: ["v:1"],
		timestamp: ["n:>=" + from + "<" + to],
		address: ["g:AGENT.OBJECTS.table." + address]
	};

	var check = webMI.data.queryFilter(queryObj, function(e) {
		if (e.result[0]) {
			for (i in e.result) {
				result.push(JSON.parse(e.result[i].value));		
			}

		}
		else result = { err: "404", value: "no data" }
		if (!isDateListWindow) {
			openListWindow(result);
			isDateListWindow = true;
		}
		else {
			tableListContainer.style.display = "none";
			isDateListWindow = false;
		}
	})
	return result
}

