function deepClone(object) {
	return JSON.parse(JSON.stringify(object))	
}

function JSONification(data) {
	potentialJSONObject = data;
	actualJSONString = JSON.stringify(potentialJSONObject);
	for (i = 0; i < potentialJSONObject.rows.length; i++) {
		potentialJSONObject.rows[i].timestamp = refreshTimestamp();
		if (potentialJSONObject.rows[i].type == "plan")	{
			actualJSONPlan = JSON.stringify(potentialJSONObject.rows[i])
		} else if (potentialJSONObject.rows[i].type == "fact") {
			actualJSONFact = JSON.stringify(potentialJSONObject.rows[i])
		}
	}

}

function refreshTimestamp(row) {

	return new Date()	
}

function reverse(data) {
	// *** SHOULD RETURN REVERSED TABLE DATA ***
	var data = deepClone(data);
	var rows = [];
	var result = new ObjectToParse();
	var reverseReg = new RegExp(delimiter + ".*", "g");

	for (var i = 0; i < data.length; i++) {
		// *** PUSH IN COLUMNS ONLY FIRST ITEMS(SUPPOSEDLY COLUMNS) ***\
		var column = data[i].replace(reverseReg, "");
		var row = [];

		result.columns.push(column);

		rows.push(data[i].replace(column, ""));
		//rows[i] = rows[i].split(delimiter);

	}

	for (var j = 0; j < result.columns.length; j++) {
		var row = [];
		row.push();
		//console.log(result.columns[j]);
		result.rows.push(rows[j]);

	}
	//console.log(result);
	return result
}

function straight(data) {
	var result = new ObjectToParse();

	result.columns = data.shift().split(delimiter);
	result.rows = data;	

	return result
}

function match(data, type) {
	if (type == "horizontal") {

		return reverseData(data);
	} else if (type == "vertical") {

		return straightData(data);	
	}
}


var columns = [""];
